import { render } from '@testing-library/react';
import React, { useEffect, useState } from 'react';
import { button, Link, useNavigate } from 'react-router-dom';
import ButtonClick from '../Button/Button';
import { MultiPlayerData, SinglePlayerData } from '../data/Data';
import ResetGame from '../functions/Reset';
import Dashboard from './Dashboard';
import './main.css'
const Main = (userChoice) => {
    // const [numberPlayer,setNumberPlayer] = useState()
    debugger
    const [choice,setChoice] = useState("X")
    let [gameString,setGameString] =useState("         ")
    let [arryOfString,setArryOfString] = useState([' ', ' ', ' ', ' ', ' ', ' ', ' ', ' ', ' '])

    // useEffect(()=>{setNumberPlayer(userChoice)},[])

    if(localStorage.getItem("splitBoard")){
            debugger
            setArryOfString(localStorage.getItem('splitBoard'))
        }
    const checkString = (e) => {
        e.preventDefault()
        const buttonarryOfString = e.target.name - 1

        const stringBundle = ""

        const stringArry = gameString.split("")
        setArryOfString(gameString.split(""))
        debugger
        if(userChoice.Uchoice === "single_player"){
            stringArry[buttonarryOfString] = "x"
            // setArryOfString(stringArry)
            const newString = stringArry.join("")
            // stringBundle = newString
        }
        else{
            stringArry[buttonarryOfString] = choice
            setArryOfString(stringArry)
            setGameString(arryOfString.join(""))
            setChoice = "o"
        }
        setGameString(stringArry.join(""))
        debugger
        return(   
           <>
           {userChoice.Uchoice === "single_player" ? SinglePlayerData(gameString) : MultiPlayerData(stringBundle)}
           {choice === "X" ? setChoice("O") : setChoice("X")}
           </> 
        )
    }


        const dataArry = ["o",'x','x',"o","o","o","x","x","o"]

        const resetGame = () => {
            const propsData = [gameString,"reset",userChoice.Uchoice]
            ResetGame(propsData)
            Dashboard(propsData)
            }   


    return(
        <>
        <h1>Main Screen</h1>
        <div class="container-fluid">
                <div className=' col-12 '>
                    <h3>Tic tac Toe</h3>
                </div>
                <div><Link onClick={resetGame} to='/' className='btn'>RESET GAME</Link></div>
                <div style={{marginTop:"8%", marginLeft:"25%", marginRight:"25%",}} className='box row'>
                    <div className='box_element col-sm border-1'>
                        <div className='element row-1'><button id="square1" name="1" className="square"  onClick={checkString}>{arryOfString[0]}</button></div>
                        <div className='row-2 element'><button id="square1" name="4" className='square' onClick={checkString}>{arryOfString[3]}</button></div>
                        <div className='row-3 element'><button id="square1" name="7" className='square' onClick={checkString}>{arryOfString[6]}</button></div>
                    </div>

                    <div className='box_element col-sm'>
                        <div className='row-1 element'><button id="square1" name="2" className='square' onClick={checkString}>{arryOfString[1]}</button></div>
                        <div className='row-2 element'><button id="square1"name="5" className='square' onClick={checkString}>{arryOfString[4]}</button></div>
                        <div className='row-3 element'><button id="square1" name="8" className='square' onClick={checkString}>{arryOfString[7]}</button></div>

                    </div>

                    <div className='box_element col-sm'>
                        <div className='row-1 element'><button id="square1" name="3" className='square' onClick={checkString}>{arryOfString[2]}</button></div>
                        <div className='row-2 element'><button id="square1" name="6" className='square' onClick={checkString}>{arryOfString[5]}</button></div>
                        <div className='row-3 element'><button id="square1" name="9" className='square' onClick={checkString}>{arryOfString[8]}</button></div>
                    </div>

                </div>
        </div>

       </>
    )
}

export default Main;
